import React, { useEffect  } from 'react';

export const DisplayDog = ({getDogFromUrl}) => {

    let dog= {}

    useEffect(() => {
        dog = getDogFromUrl()
      });

    return(
        <div className="dogImage">
            <h3>Random Dog</h3>
            <p>${dog.fileSizeBytes}</p>
            <img src="`${require(this.dog.url)}`" alt="Random Dog"/>
        </div>
    );
}

export default DisplayDog
